import { Weather } from "./Screens/Weather"
import { createNativeStackNavigator } from '@react-navigation/native-stack';


const img = require("./assets/earth.jpg");
export default function App() {

  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Weather"
          component={Weather}
          options={{ headerShown: false }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
